import { BrowserRouter as Router,  Routes, Route, BrowserRouter } from "react-router-dom";

import "./App.css";
import Navbar from "./Komponensek/Navbar/Navbar";
import Fooldal from "./Komponensek/Oldalak/Fooldal";
import LoginSignup from "./Komponensek/Oldalak/LoginSignup";
import Menu from "./Komponensek/Oldalak/Menu";
import Rendeles from "./Komponensek/Oldalak/Rendeles";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
    <Router>
        <Navbar />
        <Routes>
          <Route path="/" element={<Fooldal />} />
          <Route path="/login" element={<LoginSignup />} />
          <Route path="/menu" element={<Menu />} />
          <Route path="/rendeles" element={<Rendeles />} />
        </Routes>
      </Router>
      </BrowserRouter>
    </div>
  );
}

export default App;
